<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style>
        #container{
            width: 500px;   
        }
        svg#freepik_stories-pineapple:not(.animated) .animable {
            opacity: 0;
        }
    
        svg#freepik_stories-pineapple.animated #freepik--background-complete--inject-10 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideDown;
            animation-delay: 0s;
        }
    
        svg#freepik_stories-pineapple.animated #freepik--Floor--inject-10 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) fadeIn;
            animation-delay: 0s;
        }
    
        svg#freepik_stories-pineapple.animated #freepik--pineapple-piece-3--inject-10 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) zoomOut;
            animation-delay: 0s;
        }
    
        svg#freepik_stories-pineapple.animated #freepik--pineapple-piece-2--inject-10 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideDown;
            animation-delay: 0s;
        }
    
        svg#freepik_stories-pineapple.animated #freepik--pineapple-piece-1--inject-10 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideDown;
            animation-delay: 0s;
        }
    
        svg#freepik_stories-pineapple.animated #freepik--Pineapple--inject-10 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedLeft;
            animation-delay: 0s;
        }
    
        svg#freepik_stories-pineapple.animated #freepik--pineapple-slice--inject-10 {
            animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedLeft;
            animation-delay: 0s;
        }
    
        @keyframes slideDown {
            0% {
                opacity: 0;
                transform: translateY(-30px);
            }
    
            100% {
                opacity: 1;
                transform: translateY(0);
            }
        }
    
        @keyframes fadeIn {
            0% {
                opacity: 0;
            }
    
            100% {
                opacity: 1;
            }
        }
    
        @keyframes zoomOut {
            0% {
                opacity: 0;
                transform: scale(1.5);
            }
    
            100% {
                opacity: 1;
                transform: scale(1);
            }
        }
    
        @keyframes lightSpeedLeft {
            from {
                transform: translate3d(-50%, 0, 0) skewX(20deg);
                opacity: 0;
            }
    
            60% {
                transform: skewX(-10deg);
                opacity: 1;
            }
    
            80% {
                transform: skewX(2deg);
            }
    
            to {
                opacity: 1;
                transform: translate3d(0, 0, 0);
            }
        }
    </style>
</head>
